export default function Initial() {
    return (
        <main className="content-initial">
            <div className="logo">
                <img
                    src="/assets/img/logo.png"
                    alt=""
                />
            </div>
            <h1 className="initial-recall">
                Zap Recall
            </h1>
            <button className="initial-button">Iniciar Recall!!!</button>
        </main>
    );
}
